import React from "react";
import Wallpaper from "../commonwallpaper/Wallpaper";
import Footer from "../sign-In/Footer";
import netflixlogo from "../../assets/netflix-logos-idcIWizlPG.png";
import Dropdown from "../commonwallpaper/Dropdown";
import "./SignUp.scss"

function SignUp() {
  return (
    <div
      className="bg-black bg-opacity-100 overflow-hidden"
      style={{ backgroundColor: "#000" }}

    > 

        <div
       class="inline-block text-sm px-4 py-2 leading-none border rounded text-white border-white hover:border-transparent hover:text-teal-500 hover:bg-white mt-4 lg:mt-0"

        style={{backgroundColor:"white"}}
      >
        <Dropdown />
      </div>


    <div class="flex items-center flex-shrink-0 text-white mr-6">
    <span class="font-semibold text-xl tracking-tight"><img
          class="h-auto"
          className="img-logo1"
          src={netflixlogo}
          alt="netflix-logo"
          style={{ color: "red" }}
        /></span>
  </div>

    {/* <div className="logo-container1">
        <img
          class="h-auto"
          className="img-logo1"
          src={netflixlogo}
          alt="netflix-logo"
          style={{ color: "red" }}
        />
          </div>
         */}







      <div>
        <Wallpaper />
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
}

export default SignUp;
